INSERT INTO `post` (`id`, `title`, `body`, `category_id`, `media_type`, `file_path`, `media_url`, `is_share`, `is_comment`, `is_like`, `like_count`, `is_favorite`, `created_date`, `modified_date`) VALUES
(24, 'About BEML', 'BEML Limited (formerly Bharat Earth Movers Limited) was established in May 1964 as a Public Sector Undertaking for manufacture of Rail Coaches & Spare Parts and Mining Equipment at its Bangalore Complex. BEML Limited, a ‘Miniratna-Category-1’, plays a pivotal role and serves India’s core sectors like Defence, Rail, Power, Mining and Infrastructure.', 1, 6, '1498539757.JPG', '', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27'),
(25, 'BEML DEDICATED ENVIRONMENTAL PARK AT KGF', 'BEML LIMITED, a Mini Ratna Public Sector Company under the Ministry of Defence, has opened Environmental- Park at KGF Complex. To commemorate with the World Environment Day at a function held at BEML Township, KGF, Shri Deepak Kumar Hota, Chairman and Managing Director, BEML inaugurated the Baba Saheb Dr. BR Ambedkar environmental-Park coinciding with the theme for the year “Connecting People to Nature”.', 2, 6, '1498540125.JPG', '', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27'),
(26, 'BEML CMD CONFERRED WITH FELLOWSHIP AWARD', 'Shri Deepak Kumar Hota, Chairman & Manaing Director, BEML LIMITED, a Public Sector undertaking under the Ministry of Defence, has been conferred with CEPM Fellowship Award-2016 at the 24th Global Symposium organised by Centre for Excellence in Project Management. ', 1, 6, '1498540224.JPG', '', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27'),
(27, 'BEML BESTOWED WITH RAKSHA MANTRI AWARD', 'BEML LIMITED, a Mini Ratna Category-I Public Sector Company under the Ministry of Defence, has received the prestigious ‘Raksha Mantri’s Award for Excellence’ under the Group Award category for Design & Development of 180 Ton Class Electric Hydraulic Excavator BE1800E.', 2, 6, '1498540283.JPG', '', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27'),
(28, 'BEML BAGS ‘INDIA’s TOP CHALLENGER AWARD’ ', 'BEML LIMITED, the Public Sector Company under the Ministry of Defence, has been bestowed with the prestigious ‘Top Challengers Award’ instituted by ASAPP Info Global Group during the 14th Construction World Annual Awards-2016. ', 1, 6, '1498540360.JPG', '', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27'),
(29, 'BEML Corporate Video', 'BEML Corporate Video', 1, 5, NULL, 'https://www.youtube.com/watch?v=Rga47YJymbg', 1, 1, 1, 0, 1, '2017-06-27', '2017-06-27');
